import { createRoot } from "react-dom/client";
import { useEffect, useState } from "react";
import { BrowserRouter, Link, Route, Routes } from "react-router-dom";

const App = () => {
    const [puppies, setPuppies] = useState([]);

    async function fetchPuppyData() {
        try {
            console.log("This function is running")
            const response = await fetch("https://fsa-puppy-bowl.herokuapp.com/api/2301-FTB-MT-WEB-FT/players")
            console.log(response)
            const translatedData = await response.json();

            setPuppies(translatedData.players)
            console.log(translatedData)
        } catch (error) {
            console.log(error)
        }
    }
    useEffect(() => {
        fetchPuppyData();
    }, [])

    return (
        <BrowserRouter>
        <div>
            <nav>

            </nav>
             {
            puppies.length ? puppies.map((singlePuppyElement, idx) => {
                return (

                    <div key={idx}>
                        <p>Name: {singlePuppyElement.name}
                        </p>
                    </div>

                )
            }) : <div> No data yet...</div>
            }

            <Routes>

            </Routes>

        </div>
        </BrowserRouter>
    )
}

const appElement = document.getElementById("app")
const root = createRoot(appElement)
root.render(<App />)
